import PropTypes from 'prop-types';
import Button1 from './Button1';

const Navbar1 = ({title}) => {
  return (

    <form className="container-fluid" href="#" >
        <p className="btn0" style={{paddingTop:10}}>
        <span class="border-text">Yes!Places</span></p>           
        <Button1 label="Home"/>
        <Button1 label="Pet Restaurants"/>
        <Button1 label="Hotels"/>
        <Button1 label="Recipes"/>
        <Button1 label="Restaurants "/>
        <Button1 label="About"/>
        </form>
  )
}

Navbar1.propTypes = {
    title: PropTypes.string.isRequired,}



export default Navbar1
